selector_to_html = {"a[href=\"../Tal_og_algebra/kvadratsaetninger.html#k1\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"k1\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 1.3 </span> (1. kvadrats\u00e6tning)</p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span> og <span class=\"math notranslate nohighlight\">\\(b\\)</span> v\u00e6re vilk\u00e5rlige tal, da g\u00e6lder f\u00f8lgende identitet:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    (a+b)^2 = a^2 + b^2 + 2ab\n    \\tag{K1} \\]</div>\n</section>\n</div>", "a[href=\"../Tal_og_algebra/roedder.html#roedder\"]": "<div class=\"proof definition admonition\" id=\"roedder\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Definition 1.4 </span> (R\u00f8dder)</p>\n<section class=\"definition-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span> v\u00e6re et vilk\u00e5rligt tal. Hvis <span class=\"math notranslate nohighlight\">\\(b\\)</span> opfylder</p>\n<div class=\"math notranslate nohighlight\">\n\\[    \\sqrt[n]{a} = b \\ \\text{n\u00e5r}\\ b^n = a,\\]</div>\n<p>s\u00e5 kalder vi <span class=\"math notranslate nohighlight\">\\(b\\)</span> den <span class=\"math notranslate nohighlight\">\\(n\\)</span>\u2019te rod af <span class=\"math notranslate nohighlight\">\\(a\\)</span>.</p>\n</section>\n</div>", "a[href=\"../Tal_og_algebra/faktorisering-og-kvadratkomplettering.html#faktoriseringogkvadratkomplettering\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.5. </span>Faktorisering og kvadratkomplettering<a class=\"headerlink\" href=\"#faktorisering-og-kvadratkomplettering\" title=\"Permalink til denne overskrift\">#</a></h1><p>To vigtige discipliner, som du skal blive komfortabel med er <em>faktorisering</em> og <em>kvadratkomplettering</em>. Du har allerede st\u00f8dt p\u00e5 begrebet faktorisering i <a class=\"reference internal\" href=\"../Tal_og_algebra/regnearterne.html#regnearterne\"><span class=\"std std-numref\">Kapitel 1.3</span></a>. Kvadratkomplettering er egentlig ogs\u00e5 faktorisering, som du vil se, men metoden er s\u00e5 vigtig, at vi tildeler emnet et kapitel for sig selv.</p>", "a[href=\"#diskriminanten\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"diskriminanten\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 3.3 </span></p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Betragt andengradsligningen <span class=\"math notranslate nohighlight\">\\(ax^2 + bx + c = 0\\)</span> med diskriminant <span class=\"math notranslate nohighlight\">\\(d = b^2 - 4ac\\)</span>. Hvis</p>\n<ul class=\"simple\">\n<li><p><span class=\"math notranslate nohighlight\">\\(d &gt; 0\\)</span>, s\u00e5 har andengradsligningen to reelle r\u00f8dder.</p></li>\n<li><p><span class=\"math notranslate nohighlight\">\\(d = 0\\)</span>, s\u00e5 har andengradsligningen \u00e9n reel rod.</p></li>\n<li><p><span class=\"math notranslate nohighlight\">\\(d &lt; 0\\)</span>, s\u00e5 har andengradsligningen nul reelle r\u00f8dder.</p></li>\n</ul>\n</section>\n</div>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.6.2. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#losningsformlen-og-diskriminanten\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.6.1. </span>L\u00f8sningsformlen og diskriminanten<a class=\"headerlink\" href=\"#losningsformlen-og-diskriminanten\" title=\"Permalink til denne overskrift\">#</a></h2><p>N\u00e5r vi l\u00f8ser andengradsligninger, s\u00e5 er det en god id\u00e9 at regne diskriminanten f\u00f8rst. Diskriminanten er givet ved</p>", "a[href=\"en-ligning-med-en-ubekendt.html#simpelligningligegrad\"]": "<div class=\"proof eksempel admonition\" id=\"simpelligningligegrad\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 3.8 </span></p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Lad os l\u00f8se ligningen:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    4x^2 + 12 = 268\\]</div>\n<p>F\u00f8rst bestemmer vi grundm\u00e6ngden. Eftersom vi ikke har r\u00f8dder eller br\u00f8ker i vores oprindelige ligningsudtryk, s\u00e5 m\u00e5 <span class=\"math notranslate nohighlight\">\\(G=\\mathbb{R}\\)</span>. Vi l\u00f8ser dern\u00e6st ligningen</p>\n<div class=\"math notranslate nohighlight\">\n\\[\\begin{split}\n\\begin{align*}\n&amp;                &amp;  4x^2 + 12 &amp;= 268     &amp;   &amp;\\text{Tr\u00e6k 12 fra p\u00e5 begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  4x^2 \\cancel{+12} \\cancel{-12} &amp;= 268 - 12      &amp;   &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  4x^2 &amp;= 256               &amp;   &amp;\\text{Dvid\u00e9r med 4 p\u00e5 begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  \\frac{\\cancel{4}x^2}{\\cancel{4}} &amp;= \\frac{256}{4} &amp; &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  x^2 &amp;= 64           &amp;   &amp;\\text{Tag $\\sqrt{\\ }$ p\u00e5 begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  \\sqrt{x^{\\cancel{2}}} &amp;= \\pm \\sqrt{64} &amp;   &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  x &amp;= \\pm 8                    &amp;   &amp; \n\\end{align*}\n\\end{split}\\]</div>\n<p>Bem\u00e6rk, at vi har to l\u00f8sninger, nemlig <span class=\"math notranslate nohighlight\">\\(x=8\\)</span> eller <span class=\"math notranslate nohighlight\">\\(x=-8\\)</span>. Det skyldes, at n\u00e5r vi har en lige eksponent, s\u00e5 vil b\u00e5de et tal og det modsatte tal give samme potens. Lad os lave vores kontrol med begge l\u00f8sninger og overbevise, at dette g\u00e6lder generelt.</p>\n<p>Inds\u00e6t <span class=\"math notranslate nohighlight\">\\(x=8\\)</span> i vores oprindelige ligningsudtryk:</p>\n<div class=\"math notranslate nohighlight\">\n\\[\n\\begin{align*}\n&amp; 4\\cdot 8^2 + 12 = 4\\cdot 64 + 12 = 256 + 12 = 268\n\\end{align*}\n\\]</div>\n<p>Inds\u00e6t nu <span class=\"math notranslate nohighlight\">\\(x=-8\\)</span> i vores oprindelige ligningsudtryk:</p>\n<div class=\"math notranslate nohighlight\">\n\\[\n\\begin{align*}\n&amp; 4\\cdot (-8)^2 + 12 = 4\\cdot 64 + 12 = 256 + 12 = 268\n\\end{align*}\n\\]</div>\n<p>L\u00f8sningerne giver, at venstre- og h\u00f8jresiden af ligningen er identiske.</p>\n</section>\n</div>", "a[href=\"#loesningandengrad\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"loesningandengrad\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 3.2 </span> (L\u00f8sningsformlen for andengradsligninger)</p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Givet er en ligning p\u00e5 formen</p>\n<div class=\"math notranslate nohighlight\">\n\\[    ax^2 + bx + c = 0,\\]</div>\n<p>hvor <span class=\"math notranslate nohighlight\">\\(a\\neq 0\\)</span>. Da er l\u00f8sningen til ligningen givet ved</p>\n<div class=\"math notranslate nohighlight\">\n\\[    x = \\frac{-b \\pm \\sqrt{d}}{2a},\\]</div>\n<p>hvor <span class=\"math notranslate nohighlight\">\\(d=b^2 - 4ac\\)</span> er diskriminanten.</p>\n</section>\n</div>", "a[href=\"#andengradsligninger\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.6. </span>Andengradsligninger<a class=\"headerlink\" href=\"#andengradsligninger\" title=\"Permalink til denne overskrift\">#</a></h1><p>En andengradsligning er en ligning p\u00e5 formen</p>", "a[href=\"../Tal_og_algebra/roedder.html#ligeoguligeroedder\"]": "<div class=\"proof korollar admonition\" id=\"ligeoguligeroedder\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Korollar 1.1 </span></p>\n<section class=\"korollar-content\" id=\"proof-content\">\n<p>Betragt roden <span class=\"math notranslate nohighlight\">\\(\\sqrt[n]{-a}\\)</span>, hvor <span class=\"math notranslate nohighlight\">\\(-a\\)</span> er et negativt tal. Da g\u00e6lder f\u00f8lgende udsagn:</p>\n<ul class=\"simple\">\n<li><p>Hvis <span class=\"math notranslate nohighlight\">\\(n\\)</span> er et lige tal, s\u00e5 findes roden ikke.</p></li>\n<li><p>Hvis <span class=\"math notranslate nohighlight\">\\(n\\)</span> er et ulige tal, s\u00e5 findes roden.</p></li>\n</ul>\n</section>\n</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
